import React from 'react';
import { motion } from 'framer-motion';

const stats = [
  { label: 'ML Projects Completed', value: '5+' },
  { label: 'Domains Explored', value: '4+' },
  { label: 'Models Deployed', value: '2' }
];

const skills = [
  'Machine Learning', 'Deep Learning', 'Computer Vision', 'NLP',
  'LLM Fine-Tuning', 'Model Compression', 'Predictive Analytics',
  'FastAPI', 'Docker', 'PyTorch'
];

const About = ({ isVisible }) => {
  return (
    <section
      id="about"
      className={`section-padding bg-gray-50 dark:bg-gray-800 transition-all duration-700 ${
        isVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-10'
      }`}
    >
      <div className="container mx-auto px-4">
        <h2 className="section-title">About Me</h2>
        <p className="text-center text-gray-600 dark:text-gray-300 mb-16 max-w-3xl mx-auto">
          Exploring the vast landscape of AI—building efficient, practical, and deployment-ready solutions
        </p>

        <div className="flex flex-col lg:flex-row gap-12 items-start">

          {/* LEFT SIDE - Stats + Skills */}
          <div className="lg:w-2/5 flex flex-col gap-10">

            {/* Stats Cards */}
            <div className="grid grid-cols-3 gap-4">
              {stats.map((stat, index) => (
                <motion.div
                  key={index}
                  className="bg-white dark:bg-gray-700 p-4 rounded-xl shadow-md text-center"
                  initial={{ opacity: 0, y: 10 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.6, delay: index * 0.2 }}
                >
                  <p className="text-2xl font-bold text-blue-600 dark:text-blue-400">
                    {stat.value}
                  </p>
                  <p className="text-gray-600 dark:text-gray-300 text-sm">{stat.label}</p>
                </motion.div>
              ))}
            </div>

            {/* Skills */}
            <div className="bg-white dark:bg-gray-700 rounded-xl p-6 shadow-md">
              <h4 className="text-lg font-bold mb-4 text-center">Core Skills</h4>
              <motion.div
                className="flex flex-wrap gap-3 justify-center"
                initial="hidden"
                animate="visible"
                variants={{
                  visible: { transition: { staggerChildren: 0.08 } }
                }}
              >
                {skills.map((skill, i) => (
                  <motion.span
                    key={i}
                    className="px-4 py-2 bg-blue-100 dark:bg-blue-900/30 text-blue-800 dark:text-blue-200 text-sm font-medium rounded-full shadow-sm"
                    variants={{
                      hidden: { opacity: 0, y: 10 },
                      visible: { opacity: 1, y: 0 }
                    }}
                  >
                    {skill}
                  </motion.span>
                ))}
              </motion.div>
            </div>
          </div>

          {/* RIGHT SIDE - About Text */}
          <div className="lg:w-3/5">
            <h3 className="text-2xl font-bold mb-4 text-blue-600 dark:text-blue-400">
              Machine Learning Engineer in the Making
            </h3>
            <p className="mb-6 text-gray-700 dark:text-gray-300">
              I’m an aspiring Machine Learning Engineer passionate about solving real-world problems with AI.
              My journey includes working on diverse areas like natural language processing, computer vision,
              predictive maintenance, and edge deployment. I enjoy building models that are not only accurate
              but also efficient, explainable, and ready for production.
            </p>

            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div className="flex items-start">
                <div className="bg-blue-100 dark:bg-blue-900/50 p-3 rounded-lg mr-4">
                  <svg className="w-6 h-6 text-blue-600 dark:text-blue-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 12l2 2 4-4m5.618-4.016A11.955 11.955 0 0112 2.944a11.955 11.955 0 01-8.618 3.04A12.02 12.02 0 003 9c0 5.591 3.824 10.29 9 11.622 5.176-1.332 9-6.03 9-11.622 0-1.042-.133-2.052-.382-3.016z"></path>
                  </svg>
                </div>
                <div>
                  <h4 className="font-bold text-lg mb-1">What I’ve Explored</h4>
                  <p className="text-gray-600 dark:text-gray-400">
                    Worked on a range of machine learning applications, including computer vision for image classification, predictive modeling for maintenance forecasting, and natural language processing tasks like text classification. I’ve also explored techniques to make models more efficient, such as quantization and knowledge distillation, and deployed models using tools like FastAPI and Docker.
                  </p>
                </div>
              </div>

              <div className="flex items-start">
                <div className="bg-blue-100 dark:bg-blue-900/50 p-3 rounded-lg mr-4">
                  <svg className="w-6 h-6 text-blue-600 dark:text-blue-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M13 10V3L4 14h7v7l9-11h-7z"></path>
                  </svg>
                </div>
                <div>
                  <h4 className="font-bold text-lg mb-1">What Drives Me</h4>
                  <p className="text-gray-600 dark:text-gray-400">
                    Curiosity, adaptability, and a passion for creating AI solutions that balance innovation with practicality.
                  </p>
                </div>
              </div>
            </div>

          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
